import { Card, Col, Container, Row } from "react-bootstrap";

function Catalog(){

    const ArraysOfCatalog = [{
        id: 1,
        image: '',
        title: 'Hello world',
        text: 'Lorem ipsum dolor',
        name: 'Шары воздушные',
        cost: 2999
    }];
    const ArraysOfCatalogOnMap = ArraysOfCatalog.map((ArrayOfCatalog) => 
    <Col key = {ArrayOfCatalog.id} lg = "4" md = "6" sm = "12">
        <Card>
            <img src = {ArrayOfCatalog.image} className="w-100"/>

            <Card.Body>
                <Card.Title>{ArrayOfCatalog.title}</Card.Title>
                <Card.Text>{ArrayOfCatalog.text}</Card.Text>

                <div className="justify-content-between">
                    <p>{ArrayOfCatalog.name}</p>
                    <h4>{ArrayOfCatalog.cost}</h4>
                </div>
            </Card.Body>
        </Card>
    </Col>
    )

    return(
        <Container>
            <Row>
                {ArraysOfCatalogOnMap}
            </Row>
        </Container>
    )
}

export default Catalog;
